description:
Cast: David Forman, David Roland Frank, Jim Moore, Philippe Petit, Joel Ney, Robert Sciglimpaglia, Paul McGill, Shawn Dempewolff-Barrett, Laurence Gates, Ardis Campbell and others

Summary:
A look at tightrope walker Philippe Petit's daring, but illegal, high-wire routine performed between New York City's World Trade Center's twin towers in 1974, what some consider, &quot;the artistic crime of the century.&quot;
